import React from "react";
import moment from "moment";
import { Segment, Header, Icon, List } from "semantic-ui-react";

const Launch = props => (
  <Segment>
    <Header>{props.name}</Header>
    <List>
      <List.Item>
        <List.Icon name="rocket" color="red" />
        <List.Content>
          <a href={props.rocket.link}>{props.rocket.name}</a>
        </List.Content>
      </List.Item>
      <Icon name="group" />
      <a href={props.agency.link}>{props.agency.name}</a>
      <br />
      <Icon name="location arrow" color="blue" />
      <span>{props.location}</span>
      <br />
      <Icon name="clock" color="grey" />
      <span>{props.time}</span>

      {props.links.map((link, i) => (
        <List.Item key={i}>{link}</List.Item>
      ))}
    </List>
  </Segment>
);

export default Launch;
